public int compare(FileSummary.Section s1, FileSummary.Section s2) {
  SectionName n1 = SectionName.fromString(s1.getName());
  SectionName n2 = SectionName.fromString(s2.getName());
  if (n1 == null) {
    return n2 == null ? 0 : -1;
  } else if (n2 == null) {
    return -1;
  } else {
    return n1.ordinal() - n2.ordinal();
  }
}
